  [],\n\t\"num_tags\": 0,\n\t\"name\": \"nodc-standard-format-marine-birds-from-coastal-alaska-and-puget-sound-data-1974-1982-feeding-fl\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Feeding Flock (F037) is one of a group
  of seven datasets related tonMarine Birds from Coastal Alaska and Puget Sound Data
  (1974 -1982). Eachndataset uses the NODC Taxonomic Code to indicate species.nnFeeding
  Flock (F037) data type contains data from field observations ofnmarine bird feeding
  flocks made during air or ship surveys. These datanare collected to provide information
  on marine bird feeding dynamics,ncommunity structure, and trophic relationships.
  Start and end positions,ndate and elapsed time, course, speed, distance, altitude,
  platform typenand observing techniques are reported for each survey. Environmentalninformation
  may include meteorological and sea surface conditions,ndistances to the shoreline
  and shelf break, ice characteristics, andnsurface debris, including oil slicks.
  Flock information may includenflock height and dimensions, number of species, number
  of individualsnper species, distance to land, species and number of associated marinenmammals,
  flock behavior, interaction with other species, andnarrival/departure activities.
